const LoginModal = () => {
  return (
    <LoginBox>
      <LoginLogo>wanted</LoginLogo>
      <LoginFormBox>
        <LoginTextBox>
          <LoginTitle>직장인을 위한 <br/>커리어 플랫폼, 원티드!</LoginTitle>
          <LoginText></LoginText>
        </LoginTextBox>
      </LoginFormBox>
    </LoginBox>
  );
}

const LoginBox = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 400px;
  overflow-y: auto;
  max-width: 500px;
  max-height: calc(100vh - 150px);
  z-index: 4000;
  border-radius: 5px;
  background-color: #fff;
`
