  height: 54px;
  padding: 16px 20px;
  position: relative;
  border-bottom: 1px solid #eee;
  color: #333;
  text-align: center;
  font-size: 20px;
  font-weight: 800;
  word-wrap: break-word;
`
const LoginFormBox = styled.div`
  padding: 20px;
`
const LoginTextBox = styled.div`
  text-align: center;
  word-break: break-word;
  margin-top: 24px;
  margin-bottom: 40px;
  line-height: 1.54;
  font-size: 26px;
  font-weight: 600;
  color: #333;
`
